import React from 'react';
import BookingForm from '../components/BookingForm'; // Adjusted import path for BookingForm component
import MapContainer from '../components/MapContainer'; // Adjusted import path for MapContainer component
import '../styles/BookingPage.css'; // Correct path to the BookingPage.css file

const BookingPage = () => {
  return (
    <div className="booking-page">
      <h1 className="page-header">Book a Rescue Service</h1>
      
      {/* Map Component */}
      <MapContainer />
      
      {/* Booking Form */}
      <div className="form-container">
        <BookingForm />
      </div>
    </div>
  );
};

export default BookingPage;
